i1 = ['The Fool', 'In the fool tarot card, there is a young man standing on the edge of a cliff with a small dog at his feet. He is about to take a step off the cliff into the unknown. This card represents taking a risk, or making a decision that may not be well-thought-out. It can also indicate a sense of naivete or innocence. in the upright position, this card suggests that you are about to embark on a new journey or venture. It is important to be aware of the risks involved, but don\'t let fear hold you back. In the reversed position, the card can represent recklessness or impulsiveness. You may be acting without thinking things through, which could lead to problems down the road. Be careful not to take unnecessary risks.']
i2 = ['The Magician', 'In The Magician tarot card, the magician is depicted as a young man standing at a crossroads. He is holding a staff in one hand and a wand in the other. He is wearing a red robe and a blue scarf. Behind him is a table with a sword, a cup, a pentacle, and a wand. The magician is a symbol of power, creativity, and change. He represents the ability to manifest your desires into reality. He is also a reminder that you have the power to create your own reality. The magician is a powerful ally on your journey to success. in the upright position, the Magician tarot card represents the power of manifestation. It is a time to take control of your life and create the reality you desire. This is a time of new beginnings and limitless potential. The magician is a reminder that you have the power to create your own reality. In the reversed position, the Magician tarot card represents a lack of direction and creative power. This is a time when you may feel stuck or lost. The magician reversed is a reminder that you have the power to create your own reality. Take some time to focus on your goals and what you want to achieve.']
i3 = ['The High Priestess', 'In The High Priestess tarot card, she is a symbol of wisdom. She is also a symbol of knowledge and understanding. The High Priestess is also a symbol of intuition and psychic ability. in the upright position, The High Priestess tarot card suggests that you are in tune with your intuition and have a strong connection to your subconscious mind. You are able to access knowledge and understanding that you may not be aware of consciously. This is a time when you can trust your instincts and intuition to guide you. In the reversed position, The High Priestess tarot card suggests that you may be out of touch with your intuition and subconscious mind. You may be overthinking things and overanalyzing situations. This can lead to confusion and frustration. Trust your instincts and intuition to guide you during this time.']
i4 = ['The Empress', 'In The Empress tarot card, the woman wears a crown of twelve stars. This symbolizes the twelve zodiac signs and the twelve months of the year. She also holds a scepter in her right hand, which symbolizes her power and authority. The globe she is standing on represents the world. The Empress upright meaning, the card denotes fertility, motherhood, abundance, and nature. It suggests that you are in a creative and productive period in your life. You may be starting a new project or undertaking a new venture. This is a time of growth and expansion. You are generous and giving, and people are drawn to your warmth and nurturing energy. The reversedIn the Empress reversed meaning, the card represents infertility, loneliness, coldness, and stagnation. You may be feeling creatively blocked or stuck in a rut. Your relationship with your mother or a significant female figure may be strained. You may be feeling disconnected from your femininity or sexuality. This is a time to reconnect with your inner goddess and tap into your creative power.']
i5 = ['The Emperor', 'In The Emperor tarot card, the Emperor is shown as a mature man, with a long beard, wearing a crown and holding a sceptre. He is seated on a throne, with a lion at his feet. Behind him is a landscape of mountains and forests. The Emperor represents authority, power and strength. He is a leader who is fair and just, but also demanding and uncompromising. He represents the masculine principle in the tarot, and corresponds to the astrological sign of Aries. The upright position of The Emperor suggests that you are in a position of power and authority. You are confident and self-assured, and able to take charge and get things done. You are able to be decisive and have a clear vision of what you want to achieve. The reversed position of The Emperor suggests that you may be feeling powerless or out of control. You may be feeling frustrated or stuck in a situation. You may need to take a more assertive role in order to achieve your goals. ']
i6 = ['The Hierophant', 'In The Hierophant card, which is the second card in the Major Arcana, the Hierophant is shown seated on a throne with two followers kneeling before him. He is dressed in religious robes and has a triple crown on his head. He holds a staff in his right hand and a globe in his left hand. The Hierophant represents religious or spiritual authority. He is someone who can help you find meaning in your life, or who can teach you about the mysteries of the universe. The upright position of The Hierophant suggests that you are ready to learn from someone who can offer you guidance and wisdom. This person can help you to understand yourself and the world around you better. The Hierophant can also represent a need for structure or tradition in your life. If you are feeling lost or confused, the Hierophant can help you to find your way. The reversed position of The Hierophant suggests that you are not ready to learn from someone else. You may be feeling resistant to authority figures, or you may be questioning your own beliefs. The reversed Hierophant can also represent a lack of structure in your life. If you are feeling like you are off track, this card suggests that it may be time to seek out guidance from someone who can help you get back on track. The upright position']
i7 = ['The Lovers', 'In The Lovers card, we see a nude man and woman embracing. They appear to be in a garden, surrounded by flowers. The woman is standing on a small hill, and the man is kneeling before her. They are looking into each other\'s eyes, and both have a peaceful expression on their faces. This card represents love, romance, and relationships. It suggests that you are in a good place in your current relationship, or that you are about to embark on a new one. This is a time of happiness and contentment. Enjoy it! The upright position of The Lovers card suggests that you are in a good place in your relationship, or that you are about to embark on a new one. This is a time of happiness and contentment. Enjoy it! The reversed position of The Lovers card suggests that you may be experiencing some difficulties in your current relationship. This is a time to reflect on what is important to you, and to consider your options. The upright position']
i8 = ['The Chariot', 'In The Chariot card, you will find an image of a powerful, winged being pulling a chariot. There are also two sphinxes on either side of the chariot. The background is a stormy night sky. The Chariot symbolizes victory, triumph, and success. It also represents willpower, strength, and determination. This card suggests that you have the power and ability to achieve your goals. You just need to focus your energy and stay the course. The upright position of The Chariot suggests that you are currently in a period of success. Things are going your way and you are achieving your goals. This is a time to enjoy your victory and reap the rewards of your hard work. The reversed position of The Chariot suggests that you are facing some challenges. You may feel like you are being pulled in different directions. This is a time to focus your energy and stay the course. You will eventually triumph over your challenges. The upright position']
i9 = ['Strength', 'In The strength tarot card, it shows a nude woman with no head, but instead a crown of stars. She is rising up from a pool of water, and has two lions at her feet. The woman symbolizes strength and courage, while the lions represent protectiveness and ferocity. This card suggests that you have the inner strength and fortitude to overcome any obstacle in your path. The upright position of the Strength tarot card indicates that you are currently in a position of power. You have the ability to overcome any challenges that come your way. This is a time to be courageous and stand up for what you believe in. The reversed position of the Strength tarot card suggests that you are currently feeling weak and powerless. This is a time to draw on your inner strength and find the courage to face your fears. ']
i10 = ['The Hermit ', 'In The Hermit tarot card, the figure of the Hermit is often interpreted as a wise teacher. He is a seeker of knowledge and truth, and is often seen as a guide for others. The Hermit is also associated with introspection and contemplation, and is often seen as a symbol of wisdom and inner strength. The upright position of The Hermit tarot card can represent a time of introspection and self-reflection, when we are seeking guidance from our inner wisdom. The reversed position of The Hermit tarot card can represent a time when we are not listening to our inner voice, or when we are ignoring our intuition.']
i11 = ['Wheel of Fortune', 'In the Wheel of Fortune tarot card, the wheel is turning The Wheel of Fortune tarot card is a symbol of change. The wheel is turning, and this indicates that something is happening that will cause things to change. This can be a good or bad thing, depending on the situation. The upright position of the card indicates that the change will be for the better, while the reversed position indicates that the change will be for the worse.']
i12 = ['Justice', 'In the Justice tarot card, The Justice tarot card represents the need to be fair to yourself and others. It may also represent the need to seek justice or balance in your life. The upright position of The Justice tarot card indicates that you are in control of your own destiny and that you have the power to create your own reality. The reversed position of The Justice tarot card may represent a lack of balance in your life, or a need to seek justice from others.']
i13 = ['The Hanged Man', 'The Hanged Man tarot card, suggests that you need to be prepared to make a change in your lifestyle or circumstances. You may have been feeling trapped, restricted or bored in your current situation. The Hanged Man tells you that it\'s time for a change and that you can\'t go on like this any longer. You may need to take a new direction in your life, or make some major changes to the way you live. This may be a difficult decision, but it\'s one that you need to make. The Hanged Man also suggests that you need to let go of something that\'s been holding you back. This could be a person, a situation, or even an idea or belief. It\'s time to let go and move on. This may not be easy, but it\'s necessary in order to move forward. The Hanged Man also suggests that you\'re at a crossroads in your life. You need to make a choice and decide which path to take. This may be a difficult decision, but it\'s one that you need to make. Trust your instincts and choose the path that feels right for you. The Hanged Man is a card of transition and change. It suggests that something needs to end so that something new can begin. This may be a difficult time, but it\'s also a time of opportunity. Embrace the change and use it to your advantage. The reversed position of The Hanged Man suggests that you are resisting change. You may be afraid of the unknown or unwilling to let go of what\'s familiar. This resistance is holding you back and preventing you from moving forward. It\'s time to let go of your fears and embrace change. Trust that the universe has a plan for you and that everything will work out in the end.']
i14 = ['Death', 'The Death tarot card, is it really a death card? Death tarot cards can represent a number of different things. They can symbolize the end of something, the beginning of something, or the change of something. The upright position of the Death card can represent physical death, but it can also represent metaphorical death or rebirth. The reversed position of the Death card can represent stagnation, fear, or the avoidance of change.']
i15 = ['Temperance', 'The Temperance tarot card represents the strengths and challenges of self-control, moderation, and temperance. The key phrases associated with this card are "self-control," "moderation," and "temperance." The Temperance card suggests that you need to find balance in your life, whether it is between work and play, your body and mind, or your own emotions and the emotions of others. You may need to learn how to control your impulses, or to moderate your behavior. The Temperance card can also suggest that you need to be more patient, or to learn how to control your anger. The upright position of the Temperance card suggests that you are able to find balance in your life, and that you have the ability to control your impulses and moderate your behavior. The reversed position of the Temperance card suggests that you are out of balance in your life, and that you need to learn how to control your impulses and moderate your behavior.']
i16 = ['The Devil', 'The Devil tarot card represents the darkness and chaos of the unknown. It is a card of self-doubt, fear, and confusion. The Devil is not necessarily evil, but it is a force that can lead to chaos and destruction. The Devil card can represent our own dark desires and fears. It is a reminder that we all have a light and dark side. The Devil is a reminder to keep our darker impulses in check. When the Devil card appears in a reading, it may be indicating that you are in a situation that is full of temptation. You may be facing a choice between what is right and what is wrong. The Devil is also a reminder that we all have weaknesses and it is important to be aware of them. The Devil can also represent addiction, obsession, and lust. If you are struggling with an addiction, the Devil card is a reminder to seek help. Addiction is a powerful force that can destroy your life if you let it. The Devil card can also represent people who are manipulative and controlling. If you are in a relationship with someone who is controlling, the Devil card is a warning to beware of their influence. The Devil card can also represent your own dark side. We all have a light and dark side. The Devil card is a reminder to keep your darker impulses in check. The reversed position of the Devil card indicates that you are in control of your own destiny. You are no longer under the influence of anyone or anything. The reversed position of the Devil can also represent breaking free from an addiction or destructive relationship.']
i17 = ['The Tower', 'The Tower card represents the peak of our journey and the final challenge. We face all our fears and come to realize our strength. We celebrate our success and the lessons we have learned along the way. The Tower is the symbol of absolute power and authority. It is unshakeable, unbending, and unyielding. It represents the height of our ambition and the limits of our strength. The Tower is a reminder that we are mortal and that our time on this earth is limited. It is a warning to be prepared for the worst, for disaster can strike at any time. The Tower is also a symbol of hope, for after the darkness comes the light. The reversed position of The Tower can represent a fear of change, a resistance to authority, or a feeling of being trapped. ']
i18 = ['The Star', 'The Star tarot card represents the astrological sign of Aquarius, and its energy is that of independence and community. The card\'s image shows a man or woman (depending on the deck) with wings, holding a vessel from which water pours out. The water is a symbol of knowledge and higher understanding, and it is also representative of the spiritual realm. The wings represent the freedom that comes with this knowledge, and the ability to soar above the mundane. The main message of the Star tarot card is one of hope and optimism. No matter what challenges you may be facing in your life, the Star tarot card reminds you that there is always light at the end of the tunnel. Things may be tough right now, but if you keep your head up and have faith, you will eventually find your way back to the path of happiness. The reversed position of the Star tarot card can indicate a lack of hope, or a feeling of being lost. If you are feeling lost, it is important to remember that there is always a way back to the light. Trust your intuition, and don\'t give up on yourself. ']
i19 = ['The Moon', 'The Moon tarot card represents your emotions and intuition. The Moon is a card of illusion and deception. You may be feeling lost, confused, or deceived. The Moon is also a card of intuition and psychic ability. Trust your gut instinct and intuition when making decisions. The Moon can also represent your hidden fears and secrets. The Moon tarot card can also indicate that you are going through a period of change or transition. Change can be scary, but it is also exciting. Embrace the change and allow yourself to grow and transform. The reversed position of The Moon tarot card can represent feelings of anxiety, insecurity, and confusion. You may be overthinking things or overanalyzing a situation. Trust your intuition and gut instinct to guide you. The reversed Moon can also represent repressed emotions or hidden fears that are surfacing.']
i20 = ['The Sun', 'The Sun tarot card represents energy and life. The sun is a source of heat and light, and it is also a source of life. The sun gives us energy to live and to grow. The Sun card can also represent happiness, success, and good fortune. The sun is a symbol of hope and happiness. It can also represent new beginnings, new life, and new possibilities. The Sun card can also represent the need for activity and movement. The sun is a source of energy and it can represent the need for action. The sun can also represent the need for change. The reversed position of the Sun indicates that something is blocking your ability to shine. This may be due to feelings of insecurity or inadequacy. The reversed Sun can also represent a lack of energy or motivation.']
i21 = ['Judgment', 'The judgement tarot card represents decision making, clarity and judgement. There are a number of options presented to you. The decision you make will be the right decision, but it may not be the popular decision. You have the ability to see both sides of the situation and can balance your own emotions and desires with that of others. You are fair and just in your decisions. The judgement tarot card also represents self-reflection and inner truth. You have the ability to see yourself clearly and understand your own motives and desires. This understanding allows you to make decisions that are in alignment with your true self. You are able to see the beauty in all things, including yourself. The upright position of the judgement tarot card indicates that you are at a point in your life where you are able to make decisions with clarity and confidence. You have a strong sense of self-worth and are able to see the best in yourself and others. You are able to forgive yourself and others, and move forward with your life. The reversed position of the judgement tarot card indicates that you are feeling lost and confused. You are struggling to make decisions and feel like you are not in control of your life. You may be feeling judged by others or yourself. You may be feeling like you are not good enough. This is a time for you to take a step back and reflect on your life. You may need to make some changes in order to get back on track.']
i22 = ['The World', 'The World tarot card represents the archetypal energies of life, death and rebirth. It is a powerful image of the cycle of life and death, and the ultimate goal of human existence. The World is a symbol of completion and fulfillment, and suggests that the querent has reached a point in their life where they are ready to move on to the next level. The upright position of the World tarot card indicates that the querent is in a place of harmony and balance. They have achieved a level of success and satisfaction in their life, and are now ready to take on new challenges. The reversed position of the World tarot card suggests that the querent is out of balance and harmony. They may be feeling lost and directionless, and may need to take some time to reassess their life goals.']
i23 = ['Ace of Wands', 'Ace of Wands tarot card represents the beginning of a new adventure and the courage to pursue it. It is a card of new beginnings, creativity, and enthusiasm. In a reading, the Ace of Wands tarot card can represent a new project or opportunity that you are excited about. It is a time of new beginnings, when anything is possible. This is a good time to take risks and pursue your dreams. The Ace of Wands is also a reminder to stay positive and have faith in yourself. The reversed position of the Ace of Wands can represent a lack of motivation or inspiration. This may be a time when you feel stuck in a rut. The Ace of Wands reversed can also indicate a fear of change or taking risks.']
i24 = ['Two of Wands', 'Two of Wands tarot card represents the beginning of a journey in the exterior world. The querent finds himself or herself in an exciting new situation, with many opportunities. This situation can be business-related, or it can concern any other aspect of life. The querent is full of energy and optimistic about the future. He or she is ready to take on new challenges. The Two of Wands can also indicate a decision that needs to be made. The querent has two options before him or her, and must choose which one to pursue. This choice may be difficult, but it is necessary in order to move forward. The Two of Wands is a positive card, full of potential and possibility. It represents a time of new beginnings, when anything is possible. The querent should seize this opportunity and make the most of it. The reversed position of the Two of Wands can indicate a lack of direction or purpose. The querent may feel lost and uncertain, with no clear goal in mind. This can be a time of confusion and indecision. The querent may need to take some time to figure out what he or she wants in life.']
i25 = ['Three of Wands', 'The Three of Wands tarot card represents your ability to plan ahead with determination and foresight. You are confident in your ability to succeed and are ready to take on new challenges. You have a clear vision of what you want to achieve and are willing to put in the hard work to make it happen. You are optimistic about the future and believe that anything is possible. The Three of Wands reversed can represent a lack of direction or purpose. You may be feeling lost and uncertain of what you want to achieve. You may be lacking motivation or confidence in your ability to succeed. This can be a time of feeling stuck or stagnant in your life. Things may not be going as you had planned and you may need to make some changes.']
i26 = ['Four of Wands', 'The Four of Wands tarot card represents the bliss that comes from having accomplished something great. This card suggests a time of celebration, when all of your hard work has finally paid off. The Four of Wands is also a sign of good news and positive change. Things are going your way, and you should enjoy this time of success. When the Four of Wands appears in a reading, it is a reminder to enjoy your accomplishments. This is not the time to be modest or humble. Take a moment to celebrate your successes, and savor the good feelings that come with them. The Four of Wands also suggests that now is the time to take risks and seize opportunities. You have the wind at your back, so go for it! The reversed position of the Four of Wands suggests that you may be feeling anxious or stressed about something. You may be worried that your hard work will not pay off, or that you are not doing enough. This is a time to take a step back and assess your situation. Make sure you are putting in the effort required to achieve your goals. The reversed Four of Wands can also indicate a need for more rest and relaxation. You may be overextending yourself, and need to take a break.']
i27 = ['Five of Wands', 'The Five of Wands tarot card represents competition and conflict. This can be a time when you are involved in many projects at once, or when you feel like you are competing against others for attention or recognition. The Five of Wands can also represent a need for change or new challenges in your life. This is a time when you may feel restless or dissatisfied with your current situation. You may be seeking new opportunities or ways to express yourself. The Five of Wands suggests that you need to take action and make things happen. This is not a time to sit back and wait for things to come to you. You need to put yourself out there and be proactive. The Five of Wands tarot card can also indicate that there is some level of competition or conflict in your life. This may be something minor, such as a disagreement with a friend, or something more serious, such as a legal dispute. Whatever the case may be, it is important to remember that conflict is a natural part of life. It is how we deal with conflict that defines us. The Five of Wands suggests that you face your challenges head-on. Do not shy away from confrontation, but do not seek it out either. The Five of Wands encourages you to be assertive and stand up for yourself. Do not let others take advantage of you or push you around. Be confident in your ability to handle whatever comes your way. The reversed position of the Five of Wands suggests that you may be experiencing some difficulties in your life. This can be a time when you feel like you are being pulled in many different directions. You may feel like you are not able to focus on any one thing. The reversed Five of Wands can also represent a lack of motivation or direction. You may feel like you are just going through the motions and not really accomplishing anything. This is a time when you may need to re-evaluate your goals and figure out what it is that you really want to do with your life. The Five of Wands reversed can also indicate that there is too much conflict in your life. You may be feeling overwhelmed by all the different demands on your time and energy. This is a time when you may need to take a step back and reassess your priorities.']
i28 = ['Six of Wands', 'The Six of Wands tarot card represents victory and success. This card suggests that you have overcome a difficult situation or challenge, and are now reaping the rewards. You may be feeling confident and triumphant at this time. The Six of Wands indicates that your hard work and dedication are paying off. Keep up the good work, and you will continue to see success. In a reading, the Six of Wands can suggest that you are about to experience a major victory or accomplishment. This may be in your personal or professional life. It is a time to revel in your successes and enjoy the fruits of your labour. The Six of Wands can also indicate that you are surrounded by people who support and believe in you. These people will help you to achieve your goals. The reversed position of the Six of Wands can suggest that you are feeling less than victorious at this time. You may be facing setbacks or opposition. Alternatively, this card can suggest that you are not putting in the effort required to achieve your goals. If you want to see success, you need to put in the work.']
i29 = ['Seven of Wands', 'The seven of Wands tarot card represents someone who is feeling under pressure and has found themselves in a situation where they need to defend themselves. If you identify with this card then it is likely that you are feeling threatened or challenged in some way. You may be feeling that you are not as strong as you would like to be, or that you are being pushed beyond your limits. This can be a very stressful and challenging time, but it is also an opportunity to stand up for yourself and show your true strength. The seven of Wands suggests that you have what it takes to overcome the challenges you are facing, but you need to be willing to stand up for yourself and fight for what you believe in. This is not a time to back down or give in, but to stand your ground and show your strength of character. The reversed position of the seven of Wands suggests that you are not currently feeling very confident or capable. You may be feeling overwhelmed by the challenges you are facing and unsure of how to proceed. This is a time to take stock of your situation and to consider your options carefully. You may need to seek help and advice from others, but ultimately you will need to find your own inner strength to overcome the challenges you are facing.']
i30 = ['Eight of Wands', 'The Eight of Wands tarot card represents movement, change and progress. The card indicates that things are moving forward in your life and you are making progress. It can also represent travel, so if you are planning a trip, the Eight of Wands is a good omen. The Eight of Wands can also indicate new opportunities, so be open to new possibilities. The upright position of the card suggests that you are on the right track and things are going well. If the Eight of Wands is reversed, it can suggest delays or obstacles in your life. You may feel like you are not making progress. This can be a temporary setback, so don’t give up. The reversed position can also suggest that you are not taking advantage of opportunities that are available to you.']
i31 = ['Nine of Wands', 'The Nine of Wands tarot card represents the obstacles and challenges you face in your life. This card can also indicate that you are feeling drained and fatigued. You may be facing some difficult times ahead, but you have the strength and determination to overcome them. The upright position of the Nine of Wands suggests that you are ready to face the challenges head on. This card can also represent a test of your strength and perseverance. The reversed position of the Nine of Wands suggests that you are not as prepared to face the challenges as you thought. You may be feeling overwhelmed and discouraged. This is a time to take a step back and reassess your situation.']
i32 = [' Ten of Wands', 'The Ten of Wands tarot card represents the burdens and responsibilities you carry. This card can also indicate that you are feeling weighed down by your obligations. You may be feeling burdened by your work or family life. The upright position of the Ten of Wands suggests that you are ready to take on the challenges ahead. This card can also represent a test of your strength and endurance. The reversed position of the Ten of Wands suggests that you are not as prepared to face the challenges as you thought. You may be feeling overwhelmed and discouraged. This is a time to take a step back and reassess your situation. The upright position of the Ten of Wands suggests that you are ready to take on the challenges ahead. This card can also represent a test of your strength and endurance. The reversed position of the Ten of Wands suggests that you are not as prepared to face the challenges as you thought. You may be feeling overwhelmed and discouraged. This is a time to take a step back and reassess your situation.']
i33 = [' Page of Wands', 'The Page of Wands tarot card represents inspiration, new opportunities, and creativity. It is a card of hope and possibility, and reminds us that we all have the potential to create our own destiny. The Page of Wands is a reminder that we are all capable of great things, and that our dreams and aspirations are within our reach. This is a time to take risks and to pursue our passions with enthusiasm and vigor. The Page of Wands encourages us to be bold and to follow our hearts. It is a time to seize the day and to make our mark on the world. The upright position of the Page of Wands suggests that this is a time of positive energy and forward momentum. Things are going your way, so make the most of it! The Page of Wands reversed can indicate a lack of inspiration, or a feeling that you are stuck in a rut. This is a time to re-evaluate your goals and to find new sources of motivation. The Page of Wands reversed can also indicate a fear of success, or a reluctance to take risks. If you are feeling lost or directionless, the Page of Wands reversed is a sign that it is time to get back on track.']
i34 = [' Knight of Wands', 'The Knight of Wands tarot card represents a person on a horse who has a wand in his hand. This person is moving forward and is ready to take action. He is full of energy and enthusiasm and is ready to take on whatever comes his way. The Knight of Wands is a very positive card and represents someone who is confident and has a can-do attitude. The upright position of this card indicates that things are going well and that you are feeling positive about the future. The reversed position of this card can indicate that you are feeling stuck or that you are not sure which way to go. ']
i35 = [' Queen of Wands', 'The Queen of Wands tarot card represents a mature, loyal, and protective woman in a position of power. She is confident in her abilities and is able to offer others guidance and support. This tarot card can represent a mother figure or a positive female role model in your life. The upright position of the Queen of Wands tarot card indicates that you are able to offer others stability and security. You are able to offer others your time, energy, and resources. The reversed position of the Queen of Wands tarot card suggests that you may be feeling lost, confused, or undervalued. You may be feeling unsupported or unappreciated. This tarot card can also represent a negative female influence in your life. ']
i36 = [' King of Wands', 'The King of Wands tarot card represents someone who is creative, charismatic, and has the potential to be a great leader. The King of Wands is associated with the element of fire and represents the fire signs of the zodiac: Aries, Leo, and Sagittarius. The King of Wands is also associated with the planet Mars. The upright position of the King of Wands tarot card signifies passion, enthusiasm, and high energy. The reversed position of the King of Wands can represent someone who is impulsive, aggressive, and easily angered.']
i37 = ['Ace of Cups', 'The Ace of Cups tarot card represents love, compassion, and relationships. The cup overflows with loving emotions and represents the beginning of a new relationship or the potential for one. The Ace of Cups can also indicate a time of emotional healing in an existing relationship. The upright position of the Ace of Cups indicates positive energy and good fortune in matters of the heart. The reversed position of the Ace of Cups can suggest emotional conflicts and difficulties in relationships.']
i38 = ['Two of Cups', 'The Two of Cups tarot card represents a relationship. This relationship could be between two friends, two family members, or two lovers. The relationship is one of harmony, balance, and mutual respect. Both parties are equally invested in the relationship and feel a strong connection to one another. The Two of Cups can also represent a new relationship that is just beginning. This is a relationship that has the potential to be very fulfilling and long-lasting. Both parties feel a strong connection to one another and are eager to explore the relationship further. The Two of Cups can also represent a business partnership. This partnership is built on trust, mutual respect, and a shared vision. Both partners are committed to the success of the business and are willing to work together to achieve their goals. The reversed position of the Two of Cups can represent a relationship that is out of balance. One party may be taking more than they are giving, or there may be a lack of communication and understanding. This relationship may be heading for trouble unless the balance is restored. The Two of Cups can also represent a relationship that is no longer fulfilling. This relationship may have lost its spark and the connection between the two parties has begun to fade. It is time to move on from this relationship and find something new that brings you joy.']
i39 = ['Three of Cups', 'The Three of Cups tarot card represents the abundance of love, happiness and libido. The three women pictured on the card are celebrating the joy and pleasure of the moment. There is a feeling of completion, satisfaction and contentment. The Three of Cups is a card of celebration, friendship and pleasure. It is also a card of fertility and can represent pregnancy or childbirth. The Three of Cups tarot card can also indicate success in business and/or creative endeavors. This is a very positive card and indicates that good things are happening in your life. Enjoy the moment and do not take anything for granted. The upright position of the Three of Cups tarot card indicates that you are surrounded by love and support. Your relationships are strong and fulfilling. The reversed position of the Three of Cups tarot card can indicate a lack of emotional satisfaction. You may be feeling lonely or isolated. Your relationships may be strained or you may be going through a difficult break-up. There is a sense of emptiness and lack of fulfillment. The Three of Cups reversed can also indicate fertility issues or problems with pregnancy.']
i40 = ['Four of Cups', 'The Four of Cups tarot card represents someone who has become disconnected with the world around them. They may have retreated into themselves and their own thoughts. This can be a time of introspection and reflection. The Four of Cups can also indicate a need for some time alone. The Four of Cups can represent a period of boredom or apathy. Things may seem uninteresting or lacklustre. There may be a feeling of being stuck in a rut. This can be a time to take stock of your life and make some changes. The Four of Cups can also indicate a need for some time alone. This can be a time to focus on your own needs and wants. It may be necessary to take a break from the hustle and bustle of everyday life. This can be a time to recharge your batteries and refocus your energies. The upright position of the Four of Cups can represent a time of rest and relaxation. The reversed position of the Four of Cups can represent a period of dissatisfaction. Things may not be going the way you want them to. You may feel restless and unfulfilled. This can be a time to reassess your goals and make some changes. The reversed position of the Four of Cups can also indicate a need for some excitement in your life. You may be ready to break out of your comfort zone and try new things.']
i41 = ['Five of Cups', 'The Five of Cups tarot card represents the emotional fallout, grief, loss and regret associated with failed relationships and failed business ventures. Sometimes this card can represent the feeling of being left out or left behind. The Five of Cups suggests that you have had a recent loss or disappointment. You may be feeling sad and down about what has happened. This is a time for you to mourn your loss and to let go of what has happened. You may need to grieve for a while before you can move on. The Five of Cups also suggests that you may have some regrets about what has happened. You may be feeling guilty or responsible for what has happened. This is a time for you to forgive yourself and to let go of your guilt. You may need to forgive others who were involved in the situation as well. The Five of Cups suggests that you need to take some time to heal your wounds. You may need to spend some time alone to process your emotions. This is a time for you to deal with your loss and to start moving on with your life. The reversed position of the Five of Cups suggests that you are beginning to heal from your recent loss or disappointment. You are starting to forgive yourself and others involved. You are beginning to move on with your life.']
i42 = ['Six of Cups', 'The Six of Cups tarot card represents a time when you have the opportunity to relive your childhood, or rediscover your youth. If a child appears on this card, they represent purity of heart and innocence. This is a time to let go of the past and move forward into the future. You may be feeling nostalgic and longing for simpler times. However, it is important to remember that the past is in the past for a reason. Let go of any baggage that is holding you back and move forward with your head held high. The Six of Cups can also represent new beginnings, or a fresh start. This is a time to let go of any negativity in your life and start anew. Embrace new opportunities with open arms and a positive attitude. The reversed position of the Six of Cups can represent a lack of forgiveness, or holding on to grudges. It can also indicate that you are living in the past and not moving forward. If you are dwelling on past hurts, it is time to let them go and move on. The reversed Six of Cups can also represent a loss of innocence. ']
i43 = ['Seven of Cups', 'The seven of Cups tarot card represents an individual who is fantasizing about the future. The individual is dreaming about what could be, rather than focusing on the present. This can lead to disappointment, as the individual may not be able to achieve their dreams. The seven of Cups can also represent someone who is unsure of which path to take in life. This person may be indecisive and may have a hard time making decisions. The upright position of the seven of Cups tarot card suggests that the individual is in a good place to make their dreams a reality. They have the ability to turn their fantasies into reality. The reversed position of the seven of Cups tarot card suggests that the individual may be stuck in their current situation. They may be unhappy with their current situation and may be dreaming about what could be.']
i44 = ['Eight of Cups', 'The Eight of Cups tarot card represents your desire to retreat. You already know what you need to do. This retreat will help you gain a new perspective to your situation and make the right decisions. It may be time to leave your current situation or relationship in order to pursue a new goal. The Eight of Cups also suggests that you may be feeling disappointed or unfulfilled. This is a normal part of life and it is okay to move on. Don\'t be afraid to take risks and follow your heart. The upright position of the Eight of Cups suggests that you are ready to make a change in your life. The reversed position suggests that you may be holding onto something that is no longer serving you. It is time to let go and move on. The Eight of Cups tarot card can also represent grief or loss. This is a natural part of life and it is important to allow yourself to grieve. The death of a loved one, the end of a relationship, or the loss of a job can all be represented by this card. It is important to allow yourself to feel the pain and sorrow before you can move on. The Eight of Cups suggests that you may need some time alone to reflect on your life. This is a good time to take a break from your everyday routine and spend some time in nature. Allow yourself to feel your emotions and connect with your intuition. The answers you seek will come from within.']
i45 = ['Nine of Cups', 'The Nine of Cups tarot card represents satisfaction, contentment, and happiness. When this card appears in a reading, it suggests that your wishes will come true and you will experience a time of contentment. The Nine of Cups is also known as the Wish Card. This is because when this card appears in a reading it usually means that your wishes will come true. If you have been wanting something for a long time, the Nine of Cups suggests that your wish is about to come true. The Nine of Cups also suggests that you will be able to enjoy the fruits of your labor. This is a time when all your hard work will pay off and you will be able to enjoy the rewards. If you have been experiencing some difficulties in your life, the Nine of Cups suggests that these difficulties are about to come to an end. This is a time when things will start to go your way and you will be able to enjoy some peace and happiness. The Nine of Cups is a very positive card and it suggests that good things are on the horizon. If you have been going through some tough times, the Nine of Cups suggests that these tough times are about to end and you will be able to enjoy some good fortune. The reversed position of the Nine of Cups suggests that you may be setting your sights too high. You may be expecting too much from a situation and you may be disappointed when things don\'t turn out the way you wanted them to. The reversed position of the Nine of Cups can also suggest that you are not taking action to make your wishes come true. You may be waiting for something to happen instead of taking action to make it happen. If you want something to happen, you need to take some action to make it happen. ']
i46 = ['Ten of Cups', 'The ten of Cups tarot card represents fulfillment and abundance. You’ve worked hard to build a life that brings you happiness, and now you can enjoy the fruits of your labor. This is a time of contentment and satisfaction, when all your dreams have come true. The ten of Cups is a reminder that you are blessed, and to count your blessings. This is a time to be grateful for what you have, and to share your good fortune with others. The ten of Cups is also a sign that your cup runneth over. You have more than you need, and it’s time to give back. Pay it forward, and help others achieve their dreams. When the ten of Cups appears in a tarot reading, it indicates that your material needs will be met. You will have everything you need to live a comfortable life. This is a time of financial abundance, so don’t be afraid to spend money on the things that make you happy. The ten of Cups is also a reminder that your personal relationships are strong and supportive. The people in your life love and appreciate you, and will be there for you when you need them. Cherish these relationships, and let them help you through tough times. The reversed position of the ten of Cups indicates that you are not living up to your potential. You may be unhappy with your current situation, and feel like you’re not reaching your goals. This is a time to reassess your life, and make changes that will lead to happiness and success. The ten of Cups can also represent a false sense of security. You may be in a situation that feels too good to be true, and it may be. Be cautious, and don’t let yourself be taken advantage of. The ten of Cups is a reminder that you have everything you need to lead a joyful, abundant life. Be thankful for what you have, and share your good fortune with others.']
i47 = ['Page of Cups', 'The Page of Cups tarot card represents a lot of positive things in life. This card is all about new beginnings and fresh starts. If you have been feeling stuck in a rut, the Page of Cups is a sign that it is time to make a change. This card also represents new love, new relationships, and new opportunities. If you have been searching for a new job or a new place to live, the Page of Cups is a sign that you will find what you are looking for. The upright position of this card indicates that you are open to new experiences and new people. You are ready to take a chance and see what life has to offer. The Page of Cups tarot card can also be a sign that you are about to embark on a spiritual journey. If you have been feeling lost, the Page of Cups is a sign that you are about to find your way. This card represents new insight and new understanding. You are about to learn something new about yourself and the world around you. The Page of Cups is a positive card, and it indicates that good things are on the horizon. The reversed position of the Page of Cups tarot card can indicate that you are closed off to new experiences. You may be feeling like you are in a rut, and you are not open to new people or new opportunities. The reversed position of this card can also indicate that you are not ready to embark on a spiritual journey. You may be feeling lost, and you need to find your way before you can move forward.']
i48 = ['Knight of Cups', 'The Knight of Cups tarot card represents our deepest emotions and what they mean. We can all relate to the feeling of being in love, feeling happy, or feeling sad. These are just a few examples of the emotions that the Knight of Cups tarot card can represent. The Knight of Cups is also known as The Knight of Emotions. He is someone who wears his heart on his sleeve. He is very sensitive and compassionate. He feels things deeply and is very in tune with his emotions. He is also a romantic at heart and loves to express his feelings through poetry or song. The Knight of Cups is a positive tarot card, but he can also represent some negative aspects of our emotions. He can represent addiction, obsession, possessiveness, and jealousy. These are all emotions that can get out of control if we are not careful. The Knight of Cups tarot card can represent a new relationship or a new phase in an existing relationship. It can also represent a time when we are exploring our emotions and discovering new things about ourselves. This is a time of growth and self-discovery. If you have this tarot card in your reading, it suggests that it is time to take a look at your emotions and see what they are trying to tell you. Pay attention to your dreams and intuition as they will be guiding you during this time. In a love reading, the Knight of Cups tarot card can represent new love or a deepened connection with an existing partner. If you are single, this tarot card suggests that you may meet someone special soon. This person will be very romantic and sensitive. They will bring out the best in you and help you to grow emotionally. If you are in a relationship, the Knight of Cups tarot card suggests that you need to spend more time focusing on your emotional connection with your partner. This is not a time to take your relationship for granted. You need to nurture your relationship and make sure that it is healthy and strong. If you draw the Knight of Cups tarot card in a career reading, it suggests that you need to pay attention to your emotional needs in your job. This is not a good time to ignore your feelings or try to push them down. You need to find a way to express yourself emotionally in your work life. If you are having trouble dealing with your emotions, the Knight of Cups tarot card suggests that you seek out counseling or therapy. This is a good time to explore your emotions and learn how to deal with them in a healthy way. The reversed position of the Knight of Cups tarot card can represent emotional problems, such as addiction, obsession, possessiveness, and jealousy. It can also represent a lack of emotional connection in your relationships. If you are single, this tarot card suggests that you may be having trouble finding love. If you are in a relationship, this tarot card suggests that you may be feeling disconnected from your partner. This is a time to seek help from a therapist or counselor.']
i49 = ['Queen of Cups', 'The Queen of Cups tarot card represents the feminine, nurturing aspect of our natures. The Queen is kind, loving, and compassionate. She is a natural caregiver who is always there for those in need. The Queen of Cups is also a great listener and gives good advice. The Queen of Cups reversed can represent a woman who is cold, unemotional, or even manipulative. She may be someone who is not to be trusted. The upright position of the Queen of Cups tarot card represents a woman who is in touch with her emotions and is able to express them. She is a woman who is kind, loving, and compassionate. The reversed position of the Queen of Cups tarot card can represent a woman who is out of touch with her emotions and is unable to express them. She may be someone who is cold, unemotional, or even manipulative']
i50 = ['King of Cups', 'The King of Cups tarot card represents someone who is a counselor and mentor. They are someone who is in touch with their emotions and can be very compassionate. This person can also be very intuitive and have a strong connection to the spiritual realm. The King of Cups is often seen as a positive force in the tarot readings. The upright position of the card indicates that this person is balanced and in control of their emotions. The reversed position of the card can indicate that this person is out of balance and may be experiencing some emotional difficulties.']
i51 = ['Ace of Swords', 'The Ace of Swords tarot card represents the archetype of the visionary and pioneer. He is an innovator, iconoclast and original thinker. He has the ability to see through deception and illusion. The Ace of Swords is a powerful card of truth, justice and intellectual mastery. The Ace of Swords tarot card can represent a decision that needs to be made, or a challenge that needs to be overcome. It is a card of clarity, objectivity and unbiased thinking. The Ace of Swords can also represent a new beginning, or a new phase in life. The upright position of the Ace of Swords suggests that the querent has the ability to see through any difficulties and emerge victorious. The Ace of Swords tarot card can also indicate a need for mental discipline and focus. The querent may need to apply themselves more diligently to their studies or work in order to achieve success. This is a card of mental strength and determination. The reversed position of the Ace of Swords can suggest that the querent is experiencing confusion, ambiguity and doubt. They may be struggling to see the truth of a situation. The reversed Ace of Swords can also represent a lack of mental clarity and objectivity. The querent may be blinded by their own biases and prejudices. ']
i52 = ['Two of Swords', 'The Two of Swords tarot card represents a crossroads or a choice that must be made. It is a card about being in the middle of two different things and having to choose which one you want. The Two of Swords can represent a decision that is difficult to make, but it is also a card about finding balance and peace. The Two of Swords can also represent a time when you are feeling stuck or trapped. This may be a situation where you feel like you have no other choice but to stay where you are. The Two of Swords can also represent a time when you are trying to find your way out of a difficult situation. The Two of Swords can also represent a relationship that is in limbo. This may be a relationship that is not going anywhere or one that is on the brink of ending. The Two of Swords can also represent a friendship that is in danger of ending. The Two of Swords can also represent a situation where you are at a crossroads in your life. This may be a time when you are trying to figure out what you want to do next or where you want to go in life. The Two of Swords can also represent a time when you are trying to find your place in the world. The reversed position of the Two of Swords can represent a time when you are finally able to make a decision. This may be a decision that has been weighing on you for some time. The reversed position of the Two of Swords can also represent a time when you are able to find balance and peace in your life. The reversed position of the Two of Swords can also represent a time when you are able to get out of a difficult situation. This may be a situation that you have been stuck in for some time. The reversed position of the Two of Swords can also represent a time when you are able to end a relationship that is not going anywhere.']
i53 = ['Three of Swords', 'The Three of Swords tarot card represents heartbreak, betrayal, and grief. The image on this card is of three swords piercing a heart. This can represent the pain caused by love lost, or the betrayal of a friend or loved one. The Three of Swords can also represent the grief that comes with losing someone close to you. The upright position of this card indicates that you are currently experiencing pain and suffering. The reversed position of the Three of Swords can indicate that you are beginning to heal from your pain and suffering.']
i54 = ['Four of Swords', 'The Four of Swords tarot card represents repose after the attainment of success. As in the Three, the Swords are crossed on a white background; and they are not yet broken. The symbolism implies that after a time of triumph, one must rest in order to recharge and mentally prepare for the next stage. The upright position of the Swords signifies this time of rest as well as a new beginning. In a reading, the Four of Swords indicates a time of respite after a recent success. The querent should take this time to recharge and mentally prepare for the next stage. This card can also represent physical healing after an illness or injury. The reversed position of the Four of Swords can represent an interruption in the querent\'s plans. This may be a setback, but it is only temporary. The querent should use this time to reassess their goals and come up with a new plan.']
i55 = ['Five of Swords', 'The Five of Swords tarot card represents a person who is very unhappy with his situation, and who is feeling Victimized and Unsupported. He feels that he is at a disadvantage, and that his opponents are stronger than he is. He may feel that he is being attacked, and that he is powerless to defend himself. The Five of Swords tarot card can also represent a person who is feeling Guilty and Ashamed. He may feel that he has done something wrong, and that he deserves to be punished. He may feel that he is unworthy of love or respect. The Five of Swords tarot card can also represent a person who is feeling Jealous and Envious. He may feel that others have what he wants, and that he does not. He may feel that he is being left out, or that he is not good enough. The reversed position of the Five of Swords tarot card can represent a person who is feeling Proud and confident. He may feel that he is better than others, and that he deserves to be successful.']
i56 = ['Six of Swords', 'The Six of Swords tarot card represents a journey of the mind and soul. It is a card of introspection, contemplation, and self-reflection. This card suggests that you take some time for yourself to think about your life and your choices. It is a time to reflect on your past and to learn from your mistakes. The Six of Swords can also indicate a need to let go of something that is no longer serving you. This may be a relationship, a job, or even a way of thinking. It is time to move on and to release what is no longer helpful to you. This card suggests that you need to find balance in your life. It is time to bring peace and harmony into your life. The Six of Swords can also indicate a need for healing, both physically and emotionally. You may need to seek help from others in order to heal fully. The reversed position of the Six of Swords suggests that you are stuck in a cycle of negativity. You may be dwelling on your problems and not seeing any solutions. It is time to break out of this cycle and to start moving forward. The reversed position can also indicate that you are avoiding your problems instead of facing them.']
i57 = ['Seven of Swords', 'The Seven of Swords tarot card represents a situation where you must be very vigilant. You need to be on your toes because things are not what they seem. Things are going on behind the scenes that are not in your best interest. People may be saying one thing and doing another. You need to watch out for false promises and people who are not being truthful with you. You may feel like you are being stabbed in the back. You may feel like you are being betrayed by someone you trust. This is a time when it is very important to be careful about who you trust. You need to be careful about what you say and who you say it to. This is a time when it is very important to think before you speak. The Seven of Swords can also represent a situation where you are being asked to do something that you don’t want to do. You may feel like you are being forced into a corner. You may feel like you have no choice but to do something that you don’t want to do. This is a time when it is very important to stand up for yourself. You need to be true to yourself and your own values. The Seven of Swords can also represent a situation where you are being asked to make a sacrifice. You may have to give up something that is important to you in order to get what you want. This is a time when it is very important to think about what is truly important to you. You need to be willing to let go of something that is not essential in order to gain something that is. The reversed position of the Seven of Swords suggests that the situation is not as bad as it seems. You may have been overreacting. Things may not be as dire as you thought they were. It is important to take a step back and look at the situation from a different perspective. The Seven of Swords can also suggest that you have been too trusting. You may have been too trusting of someone who is not worthy of your trust. This is a time when it is very important to be careful about who you trust. You need to be careful about what you say and who you say it to. This is a time when it is very important to think before you speak.']
i58 = ['Eight of Swords', 'The Eight of Swords tarot card represents a period of self-imposed isolation and inactivity. You may be feeling trapped, limited, and helpless. Your situation may feel hopeless and you may be feeling stuck. The Eight of Swords can represent a period of depression, despair, and fear. You may feel like you are in a dark place and that there is no way out. You may feel like you are alone and that no one can help you. The Eight of Swords can also indicate that you are holding yourself back. You may be afraid to take risks or to try new things. You may be afraid to fail or to be rejected. The Eight of Swords can represent a need for introspection and reflection. You may need to take some time for yourself to figure out what you want and what you need to do. You may need to find your own strength and resources to get through this period. The upright position of the Eight of Swords can represent a situation that is temporary and that you will eventually be able to move on from. The card can also indicate that you are ready to face your fears and to take action. The reversed position of the Eight of Swords can represent a situation that is permanent and that you will not be able to move on from. The card can also indicate that you are not ready to face your fears or to take action.']
i59 = ['Nine of Swords', 'The Nine of Swords tarot card represents grief and pain, but also a sense of self-pity and regret. The figure in the card is often seen as being trapped in their own mind, and they may be living in a state of constant fear or worry. The Nine of Swords can indicate that someone is feeling overwhelmed by their problems and they may feel like they are never going to be able to get out of their current situation. If you have drawn the Nine of Swords in a reading, it may be a sign that you are feeling overwhelmed by your current circumstances. You may feel like you are never going to be able to get out of your current situation, and you may be living in a state of constant fear or worry. The Nine of Swords can also indicate that you are feeling a great deal of self-pity and regret. In a love reading, the Nine of Swords can indicate that you are feeling overwhelmed by your relationship. You may feel like you are never going to be able to make things work, and you may be living in a state of constant fear or worry. The Nine of Swords can also indicate that you are feeling a great deal of self-pity and regret. The reversed position of the Nine of Swords can represent a release from your current situation. You may be able to see a way out of your current problems, and you may be able to find some peace and calm in your life. The reversed Nine of Swords can also indicate that you are no longer feeling overwhelmed by your problems, and you are beginning to see some hope for the future.']
i60 = ['Ten of Swords', 'The Ten of Swords tarot card represents an ending in your life. It can be a job, a relationship, a friendship. It can also represent the end of a phase in your life such as childhood or adolescence. The Ten of Swords can also indicate the death of a loved one." The Ten of Swords also symbolizes betrayal and heartbreak. The upright position of the card indicates that you are ready to move on from whatever is causing you pain. The reversed position suggests that you are still dwelling on your hurt and may need some time to heal. The reversed position can also suggest that you are in denial about the situation and may be refusing to accept that it is over. ']
i61 = ['Page of Swords', 'The Page of Swords tarot card represents the archetype of the adventurer. This archetype represents the energy of exploration, searching for new ideas and knowledge, and seeking clarity in your thoughts. The Page of Swords tarot card also symbolizes the need to be adaptable and resourceful in your actions. You may find yourself in a situation where you need to be quick-thinking and quick-acting. The Page of Swords suggests that you take some time for yourself to think things through before taking any action. The Page of Swords tarot card can also indicate a time of mental confusion or chaos. You may feel like you are swimming in a sea of conflicting thoughts and emotions. It is important to find some time to sort through your thoughts and feelings so that you can make sense of them. The Page of Swords suggests that you take some time for yourself to think things through before taking any action. The reversed position of the Page of Swords tarot card can represent an individual who is prone to gossiping, manipulation, and lies. This person may be someone who is causing drama and chaos in your life. It is important to be aware of this person and to protect yourself from their negative influence.']
i62 = ['Knight of Swords', 'The Knight of Swords tarot card represents a young knight who is very confident in his ability to win the day, whatever that battle may be. He is very decisive and sure of himself, and will not hesitate to take whatever actions are necessary to achieve his goals. He can be a great leader, but can also be very impulsive and rash. He is always moving forward and rarely looks back, which can sometimes lead him into trouble. He is a powerful force for good, but must be careful not to become over-confident or arrogant. The Knight of Swords tarot card reversed represents a young knight who is full of doubts and fears. He is indecisive and hesitant, and will often second-guess himself. He can be easily shaken by adversity, and may even give up entirely if things seem too difficult. He is a powerful force for good, but must learn to overcome his fears and doubts if he is to succeed. The upright position of the Knight of Swords tarot card suggests that you are full of energy, enthusiasm and courage at the moment. You feel confident and ready to take on whatever challenges come your way. You are decisive and sure of yourself, and are not afraid to take whatever actions are necessary to achieve your goals. Things are going well for you at the moment, and you are moving forward confidently. The reversed position of the Knight of Swords tarot card suggests that you are feeling doubts and fears at the moment. You may be second-guessing yourself and your abilities, and feel like you can\'t succeed. Things may seem too difficult or challenging right now, and you may be tempted to give up. It is important to overcome your fears and doubts, and to believe in yourself if you want to succeed. ']
i63 = ['Queen of Swords', 'The Queen of Swords tarot card represents the feminine energy of logic, intelligence and justice. It is a card of reason and fairness. The Queen of Swords is often seen as a fair and just person who is able to see both sides of an argument. She is often a good judge of character and is quick to see the truth in any situation. The Queen of Swords is also a very independent woman who does not rely on others for her opinion. The upright position of the Queen of Swords tarot card signifies that you are able to see both sides of a situation clearly and make a decision based on facts and logic. The reversed position of the Queen of Swords tarot card can represent a woman who is overly emotional and quick to judge. She may also be someone who is very cold and unemotional.']
i64 = ['King of Swords', 'The King of Swords tarot card represents someone who will be determined and decisive. He is a natural leader and often has the ability to think very clearly in difficult situations. He is often just and fair, but can also be quite ruthless if necessary. The King of Swords can represent a father figure, a boss, or any other authority figure in your life. The upright position of the card indicates that someone in a position of power will be making an important decision soon. If you are waiting for an important decision to be made, this card suggests that it will be made in a just and fair way. The reversed position of the card suggests that someone in a position of power will make a rash or unfair decision. This could have negative consequences for you or someone you know.']
i65 = ['Ace of Pentacles', 'The Ace of Pentacles tarot card represents success, prosperity, financial security and abundance. This card suggests that your material desires are about to be fulfilled. A new opportunity for wealth and abundance is on its way. The Ace of Pentacles also suggests that you have the power to manifest your desires into reality. This is a very positive and optimistic card. It indicates that good things are coming your way. The Ace of Pentacles is also a very practical card. It suggests that you take action and make things happen. This is not a time to sit back and wait for things to happen. You need to take charge and make things happen. The Ace of Pentacles also suggests that you use your resources wisely. This is a time to be responsible with your finances and your possessions. When the Ace of Pentacles appears in a tarot reading, it is a very positive sign. It suggests that you are about to experience success, prosperity, financial security and abundance. This is a very good time to make your dreams come true. The Ace of Pentacles also suggests that you have the power to manifest your desires into reality. This is a very positive and optimistic card. It indicates that good things are coming your way. The reversed position of the Ace of Pentacles suggests that you are not using your resources wisely. You may be wasting your money on unnecessary things. This is a time to be more responsible with your finances. The reversed Ace of Pentacles also suggests that you are not taking action to make your dreams come true. You may be waiting for things to happen instead of making them happen. This is a time to take charge and make things happen.']
i66 = ['Two of Pentacles', 'The Two of Pentacles tarot card represents the balancing of two critical areas in your life. The Two of Pentacles is a minor arcana card, so it cannot indicate the same level of importance as a major arcana card. However, the Two of Pentacles can symbolize the integration of different parts of your life (work and play, for example) to create a more balanced whole. The Two of Pentacles also represents making adjustments to your life to ensure that you receive what you are due (whether this is material goods, recognition for your work, or simply greater harmony in your life). The upright position of the Two of Pentacles indicates that you are managing different areas of your life well and creating a good balance. The reversed position of the Two of Pentacles indicates that you may be experiencing some imbalance in your life and that you need to make some adjustments.']
i67 = ['Three of Pentacles', 'The Three of Pentacles tarot card represents a celebration of your skills, talents and achievements. It indicates a time of recognition, reward and/or financial gain for your hard work. The Three of Pentacles also suggests that you put your skills to good use in order to achieve success. The Three of Pentacles can be a very positive card, but it can also indicate that you are too focused on material gain and not enough on the spiritual side of life. Remember that balance is key in all things. The upright position of the Three of Pentacles suggests that you are currently in a good place in your life, but be careful not to let your success go to your head. The reversed position of the Three of Pentacles suggests that you may be experiencing some setbacks in your career or finances. This is a time to take a step back and reassess your goals. You may need to readjust your plans in order to get back on track.']
i68 = ['Four of Pentacles', 'The Four of Pentacles tarot card represents selfishness and materialism. You are holding on to your possessions too tightly and are not giving others a fair chance. You are also being too stingy with your money and resources. This is preventing you from enjoying life to the fullest. The Four of Pentacles suggests that you take a step back and reassess your priorities. It is time to let go of your possessions and start enjoying life again. Stop being so stingy with your money and resources. Share them with others and you will be surprised at how much better you will feel. The upright position of the card indicates that you have the power to change your current situation. Reversed Meaning When the Four of Pentacles tarot card is reversed, it suggests that you are finally letting go of your materialistic ways. You are now more generous with your money and resources. You are also starting to enjoy life more and are no longer so selfish. This is a positive change and will lead to greater happiness in your life. ']
i69 = ['Five of Pentacles', 'The Five of Pentacles tarot card represents the rough patch people face when in need of help and the journey it takes to get back on track. The Five of Pentacles is a card that speaks to the challenges faced when one is in need of assistance. It can represent a time of financial hardship, illness, or any other difficult circumstance. This card suggests that the individual is feeling lost and alone, struggling to make ends meet. The good news is that help is on the way, but it will take some effort to get back on track. This card encourages the individual to reach out for help, whether it be from friends, family, or other resources. With perseverance and determination, the individual will eventually overcome these difficulties. The reversed position of the Five of Pentacles suggests that the individual has started to turn their situation around. They are no longer feeling helpless and hopeless, and are instead taking steps to improve their circumstances. This is a positive sign that progress is being made, and the individual will eventually reach a place of stability and security. ']
i70 = ['Six of Pentacles', 'The Six of Pentacles tarot card represents a situation which involves sharing your personal wealth or abundance with others. It can also represent financial aid, generosity, and giving back to your community or to those in need. The image on the card shows a wealthy man seated on a throne, surrounded by six pentacles. He is holding two pentacles in his hands, and the other four are scattered around him. The man looks happy and content, and his expression shows that he is generous and willing to share his wealth with others. The Six of Pentacles suggests that you are in a position to be generous and to help others. This may be financial help, but it could also be in the form of your time, energy, or knowledge. Whatever form it takes, your generosity will be appreciated and will make a difference in the lives of those you help. The Six of Pentacles can also represent a need for balance in your own life. If you have been focusing too much on work or material possessions, this card is a reminder to take some time for yourself and to enjoy the simple things in life. The Six of Pentacles suggests that you have everything you need, so now is the time to relax and enjoy what you have. If you are facing a difficult decision, the Six of Pentacles suggests that you should consult with others before making a final decision. Other people may have valuable insights that you haven’t considered, so it’s important to get input from as many people as possible before coming to a conclusion. In a reading, the Six of Pentacles can represent financial abundance, generosity, giving back to the community, or a need for balance in your own life. The reversed position of the Six of Pentacles suggests that you are not in a position to be generous at this time. This may be due to financial difficulties, or it may be that you are too focused on your own needs and concerns to think about giving to others. The reversed Six of Pentacles can also represent greed, selfishness, or a feeling of entitlement. If this card comes up in a reading, it is a reminder to think about how your actions will affect others, and to act with compassion and generosity.']
i71 = ['Seven of Pentacles', 'The Seven of Pentacles tarot card represents a crossroads in your life. You have worked hard and achieved a great deal, but now you stand at a fork in the road. You must decide whether to stay on the same path or take a new one. The Seven of Pentacles tarot card can also represent a need for balance in your life. You may be working too hard and need to take some time for yourself. Alternatively, you may be neglecting your work and need to get back on track. This card can also indicate that you are considering making a major financial investment. You will need to carefully weigh the pros and cons before making a decision. The reversed position of the Seven of Pentacles tarot card suggests that you may be making a hasty decision or acting impulsively. ']
i72 = ['Eight of Pentacles', 'The Eight of Pentacles tarot card represents the meaning of attainment. You are working hard, you are disciplined and you are gaining the rewards of all your efforts. You have a plan and you are sticking to it. You are seeing the fruits of your labor. You are feeling confident and proud of what you have accomplished. The Eight of Pentacles can also indicate that you are so focused on your work that you may be neglecting other areas of your life. You may need to take a step back and reassess your priorities. Make sure you are taking care of yourself physically, emotionally, and spiritually, not just professionally. The reversed position of the Eight of Pentacles can also suggest that you are not seeing the results you want from your efforts. You may need to reassess your plan and make some changes.']
i73 = ['Nine of Pentacles', 'The Nine of Pentacles tarot card represents a time of abundance and a season of luck in financial matters. This card is traditionally associated with the element of earth, and as such, it is linked to material things such as money and possessions. In a reading, the Nine of Pentacles can indicate that you are about to experience a time of great prosperity. If you have been experiencing financial difficulties, this card suggests that things are about to take a turn for the better. You may receive an inheritance, come into a large sum of money, or make a major financial investment that pays off handsomely. Alternatively, the Nine of Pentacles can represent physical health and well-being. This is a good time to take care of your body and treat yourself to some luxury items. The Nine of Pentacles is also a card of self-sufficiency. You are confident in your abilities and are able to provide for yourself without depending on others. This is a good time to focus on your own needs and goals, and not let others interfere with your plans. The reversed position of the Nine of Pentacles can indicate that you are feeling lost and confused. You may be going through a tough financial patch, or you may be worried about your physical health. This is a good time to seek advice from those who know more than you do, and to take care of yourself physically and emotionally.']
i74 = ['Ten of Pentacles', 'The Ten of Pentacles tarot card represents a relationship and connection with wealth, money, and abundance. The image on the card is of a man sitting on a throne with a large pentacle in the background. The man is surrounded by ten smaller pentacles, representing the different aspects of his life that are connected to wealth and abundance. The Ten of Pentacles tarot card can represent a time when you are surrounded by material wealth and abundance. This may be a time when you have come into a large sum of money, or when you are experiencing financial stability and security. The Ten of Pentacles can also represent a time when you are surrounded by family and friends who are supportive and loving. This is a time when you feel safe and secure in your relationships. The reversed position of the Ten of Pentacles tarot card can represent a time when you are feeling disconnected from your wealth and abundance. This may be a time when you are facing financial difficulties or when you are feeling alone and isolated.']
i75 = ['Page of Pentacles', 'The Page of Pentacles tarot card represents a time of gradual growth and abundance. This is a time of material gain, financial stability, and material comfort. The Page of Pentacles is a positive omen for all matters related to money, business, and material possessions. The Page of Pentacles is a card of new beginnings, new opportunities, and new ventures. This is a time to take risks, to venture into new territory, and to explore all that life has to offer. The Page of Pentacles is a time of abundance, fertility, and prosperity. This is a time to enjoy the fruits of your labor, and to reap the rewards of your hard work. The reversed position of the Page of Pentacles suggests that you may be experiencing a time of financial difficulty or insecurity. This is a time to be careful with your money, to avoid taking unnecessary risks, and to be cautious with your business dealings. The reversed Page of Pentacles can also indicate a period of laziness, apathy, and stagnation. This is a time to get moving, to take action, and to make things happen.']
i76 = ['Knight of Pentacles', 'The Knight of Pentacles tarot card represents a very determined person who likes to plan and prepare for everything in advance. They are always on the lookout for new opportunities and are very quick to seize them. They are also very good at following through on their commitments and are very reliable. The Knight of Pentacles is a very down to earth person who is not afraid of hard work. They are very practical and level headed, and always think before they act. They are also very patient and can be very stubborn when they need to be. The Knight of Pentacles is a very stable person who is not easily swayed by emotions. They are very loyal and will always stick to their word. They are also very reliable and can be counted on in a pinch. The reversed position of the Knight of Pentacles can represent someone who is too rigid and inflexible, or someone who is not able to follow through on their commitments.']
i77 = ['Queen of Pentacles', 'The Queen of Pentacles tarot card represents a loving and nurturing woman who radiates her femininity and Earth’s bounty. She is a provider and protector, a nurturing mother figure who helps others to grow and prosper. The Queen of Pentacles is a positive force in the tarot, representing abundance, fertility, and security. She is a down-to-earth woman who is loyal and reliable, always there to help in whatever way she can. The Queen of Pentacles is usually depicted as a beautiful woman surrounded by nature. She is often shown seated on a throne with a pentacle in her lap, representing her ability to manifest her desires into reality. The Queen of Pentacles is associated with the element of Earth, and her energies are grounding and stable. She is a practical woman who knows the value of hard work and perseverance. The Queen of Pentacles is someone you can always count on to be there for you, no matter what. The reversed position of the Queen of Pentacles can represent a woman who is out of touch with her feminine side, or who is overindulgent and lazy. She may be materialistic and obsessed with money and possessions. The reversed Queen of Pentacles can also indicate a woman who is having financial difficulties, or who is feeling insecure and lacking in self-worth.']
i78 = ['King of Pentacles', 'The King of Pentacles tarot card represents stability, security, materialism, and wealth. The King of Pentacles is all about feeling financially safe and secure. He is a provider and a protector. The King of Pentacles is also a great teacher. He can teach you how to handle your finances and how to be responsible with your money. The King of Pentacles is a very down to earth card. He is not interested in flashy things or in impressing others with his wealth. The King of Pentacles is interested in security and stability. He wants to know that he can provide for his family and that his financial situation is secure. The King of Pentacles is a hard worker and he expects the same from those around him. The King of Pentacles tarot card can represent a father figure or a male authority figure in your life. This person is someone who you look up to and who you respect. This person may be your boss, your father, or your husband. The King of Pentacles is someone who you can rely on to provide for you and to protect you. The King of Pentacles tarot card can also represent yourself if you are feeling financially secure and stable. You may be in a good financial situation right now and you may be feeling confident about your future. If you are the King of Pentacles, then you are a hard worker and you are responsible with your money. You are someone who others can rely on. The reversed position of the King of Pentacles can represent someone who is not financially secure or who is not responsible with their money. This person may be in debt or they may be struggling to make ends meet. The reversed King of Pentacles can also represent someone who is lazy or who is not a hard worker.']


